import React from "react";
import Card from "./Card";

function CardList({ cardList, removeCard }) {

    return (
        <>
            <h5 style={{paddingTop: "1em"}}>Cards</h5>
            {cardList.map(card => <Card card={card} removeCard={removeCard}/>)}
        </>
    );
}

export default CardList;
